sources.assets/sass/_header.scss:
header{
    width: 100vw;
    height: 10vh;
    @include flexbox( row, space-between, center );
    img{
        width: auto;
        height: inherit;
    }
    font-family: $font-normal;
    background-color: $bg-header;
    color: $color-main;
    overflow: hidden;
}
.buscar{
    font-size: map-get($fs, small);
    width: 50%;
    @include flexbox( row, space-between, center );
    input{
        border: $border-search;
        border-radius: $r-search;
        outline: none;
        padding: 5px 10px 5px 15px;
        width: 100%;
    }
    input:focus{
        border-color: $border-color;
    }
    button {
        background: transparent;
        border: none;
        outline: none;
        img{
            width:25px;
            height: 25px;
        }

    }
}
.mobile{
    button{
        background: transparent;
        border: none;
        outline: none;
    }
    button img{
        width: 25px;
        height: 25px;
    }
    float: left;
    overflow: hidden;
}
.mobile .dropbtn{
    cursor: pointer;
    border: none;
    outline: none;
    margin: 0;
}
.link{
    text-decoration: none;
    float:left;
    color: $color-dropdown; 
    text-align: center;
}
.link:hover{
    color: $color-linkhover;
}
.sub-link {
    padding-left: 1em;
}
.sub-link a:hover{
    color: $color-linkhover;
}
.dropbtn:focus{
    background-color: $color-linkhover;
}
.sesion{
    @include flexbox( row, flex-end, center );
    margin: 3px;

}
.inicia{
    margin-left:20px;
    margin-right: 10px;
    background-color: transparent;
    border: $border-login;
    border-radius: $r-button;
    color: $color-login;
    a{
        text-decoration: none;
        color: $color-login;
    }
    padding: 3px;
}
.crea{
    margin-right: 20px;
    background-color: transparent;
    border: $border-register;
    border-radius: $r-button;
    color: $color-login;
    a{
        text-decoration: none;
        color: $color-login;
    }
    a:hover{
        color: $color-register;
    }
    padding: 3px;
}
ul, li{
    text-decoration: none;
    list-style:none;
}
.dropdown-content{
    font-family: $font-normal;
    font-size: map-get($fs, large);
    background: $bg-dropdown;
    opacity: .9 ;
    color: $color-dropdown;
    display:none;
    position: absolute;
    left: 0;
    top: 0;
    width: 100vw;
    height: 100vh;
    z-index: 1;
    padding-left: .5em;
    padding-top: 1em;
}
.dropdown-content .link{
    float: none;
    color: $color-dropdown;
    font-family: $font-normal;
    font-size: map-get($fs, large);
    text-decoration: none;
    text-align: left;
}
.dropdown-content a:hover {
    color: $color-linkhover;
  }
.show{
    display:block;
}
#menu-desktop ul{
    list-style: none;
    margin: 0;
    padding: 0;
}
#menu-desktop ul li{
    position: relative;
    float: left;
    margin: 0;
    padding: 0;
}
#menu-desktop ul a{
    display: block;
    color: $color-link;
    text-decoration: none;
    font-family: $font-normal;
    font-size: map-get($fs, normal);
    padding: 1em;
}
#menu-desktop ul:hover{
    color: $color-menuhover;
}
#menu-desktop ul li:hover{
    background: $bg-submenuhover;
    color: $color-linkhover;
}
#menu-desktop ul ul{
    display:none;
    position: absolute;
    top: 100%;
    left: 0;
    background: $bg-menuhover;
    padding: 0;
    z-index: 3;
}
#menu-desktop ul ul li{
    float: none;
    width: 300px;
}
#menu-desktop ul ul a{
    line-height: 120%;
    padding: 10px 15px;
}
#menu-desktop ul li:hover > ul{
    display: block;
}

sources.assets/sass/_mixins.scss:
@mixin flexbox( $flex-direction: row, $justify-content, $align-items ){
    display: flex;
    flex-direction: $flex-direction;
    justify-content: $justify-content;
    align-items: $align-items;
}
@mixin grid($n_rows: 1, $n_columns: 1) {
    display: grid;
    grid-template-rows: repeat($n_rows, auto);
    grid-template-columns: repeat($n_columns, auto);
}

